CREATE TABLE public.hold_hist (
    day date NOT NULL,
    price numeric(16,8),
    btc numeric(16,8),
    usd numeric(16,8),
    val numeric(16,8),
    del_btc numeric(16,8),
    del_usd numeric(16,8)
);


CREATE TABLE public.hold_hist (
    day date NOT NULL,
    price numeric(16,8),
    btc numeric(16,8),
    usd numeric(16,8),
    btc_val numeric(16,8),
    tot_val numeric(16,8),
    usd_goal numeric(16,8),
    btc_goal numeric(16,8),
    del_btc numeric(16,8),
    del_usd numeric(16,8)
);

ALTER TABLE ONLY public.hold_hist
    ADD CONSTRAINT hold_hist_pkey PRIMARY KEY (day);

CREATE TABLE public.btc_hist (
    day date NOT NULL,
    open numeric(16,8),
    high numeric(16,8),
    low numeric(16,8),
    close numeric(16,8),
    adj_close numeric(16,8),
    volume numeric(20,8)
);
ALTER TABLE ONLY public.btc_hist
    ADD CONSTRAINT btc_hist_pkey PRIMARY KEY (day);

CREATE VIEW public.next_hist AS
 SELECT min(btc_hist.day) AS day
   FROM public.btc_hist
  WHERE (NOT (btc_hist.day IN ( SELECT hold_hist.day
           FROM public.hold_hist)));



